import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App_Relogio from './App_Relogio';
import App_Cronometro from './App_Cronometro';
import App_Temporizador from './App_Temporizador';
import * as serviceWorker from './serviceWorker';
import { BrowserRouter, Switch, Route } from 'react-router-dom';
import 'bootstrap/dist/css/bootstrap.min.css';


ReactDOM.render(
	<React.StrictMode>
		<BrowserRouter>
			<Switch>
				<Route path="/" exact={true} component={App_relogio}/>
				<Route path="/Cronometro" component={App_Cronometro}/>
				<Route path="/Temporizador" component={App_Temporizador}/>
			</Switch>
		</BrowserRouter>
	</React.StrictMode>,
	document.getElementById('root')
);

// If you want your app to work offline and load faster, you can change
// unregister() to register() below. Note this comes with some pitfalls.
// Learn more about service workers: https://bit.ly/CRA-PWA
serviceWorker.unregister();
